`,"with-friends":"with-friends"},Babel:zv,"The Book of Goose":{Rating:"",Author:"Yiyun Li",Month:1,Language:"ENG",Genre:["Fiction"],Thoughts:"Really liked the first 50 pages, but the rest seems to get a little bit too old."},"Pet Sematary":{Rating:"",Author:"Stephen King",Month:6,Language:"ENG",Genre:["Horror"],Thoughts:"","with-friends":"with-friends"},"The Seven Husbands of Evelyn Hugo":{Rating:"",Author:"Taylor Jenkins Reid",Month:6,Language:"ENG",Genre:["Fiction"],Thoughts:"very hooky and also pretty"},"The Berry Pickers":{Rating:"",Author:"Amanda Peters",Month:6,Language:"ENG",Genre:["Fiction"],"with-friends":"with-friends"},I:{Rating:"",Author:"",Month:8,Language:"",Genre:["SciFi"],"with-friends":"with-friends"},:{Rating:"",Author:"",Month:8,Language:"",Genre:["Mystery"],Thoughts:"The main character is obsessed with 'keeping his family together'. He receives a potion that allows him to branch at any point in time and travel back in time; but only 50% of the time would he actually succeed. I liked the set-up and the mystery, but the imagery is violent, gruesome, and quite sexual. It can be uncomfortable, but the mystery does not disappoint! The twists and narration adds a lot."},"Why Fish Dont Exist":{Rating:"",Author:"Lulu Miller",Month:8,Language:"ENG",Genre:["Non-Fiction"],Thoughts:"The author interweaves her own experience with 'chaos' and the things that don't go well in life, with a biography of David Starr Jordan. I had a lot of excitement for this book, since I like fish, and the premise of exploring chaos while collecting fish sounded interesting. However, the author sometimes tunes in to her private life a little too much for me, and a lot of time I don't agree with her moral values expressed in the book. The over-positive + bursting with excitement writing style also got too cringe for me.","with-friends":"with-friends"},II:{Rating:"",Author:"",Month:8,Language:"",Genre:["SciFi"],Thoughts:"III","with-friends":"with-friends"},"Kim Jiyoung, Born 1982":{Rating:"",Author:"Cho Nam-ju",Month:8,Language:"",Thoughts:"A depiction drawing out the life of 'any' east asian woman. I was amazed to find so many gender roles, phrases, and experiences that are also stereotypically experienced by Chinese women, although the main character is Korean. The extremely calm, casual, and daily narration strikingly outlines out how realistic and 'normal' the main character's experience is.",Genre:["Fiction"]},:{Rating:"",Author:"",Month:11,Language:"",Thoughts:"",Genre:["Romance","Mystery"]},"Warriors: Into the Wild":{Rating:"",Author:"Erin Hunter",Month:12,Language:"ENG",Thoughts:"I've never read Warriors before, but I see my friend re-reading it this past semester, so after a not very smooth semester I wanted to binge read a book that is more chill. I enjoyed the story, especially the pacing and characters were introduced well, such that I didn't lose track of the cat names. However, I did not expect so many cats would be violently attacked, but it's the wilderness I guess :< ",Genre:["Fantasy"]},"The Spear Cuts Through Water":{Rating:"",Author:"Simon Jimenez",Month:12,Language:"ENG",Thoughts:"This is the fourth fantasy I've read with friends. I love this one for its lowkey and not overpowering romance developed between Keema and Jun, adventure-centered plot, and a writing style that I'm not familiar with, making the reading experience super unique. The main story is told in a theatre setting, and the POV switches from an audience in second person, a third person narrating the main story, to scattered throughout, first person snippets appending outsider perspectives for context of the setting. The switching was challenging for me to pick up, making some parts harder to understand and the beginning slower to read. However, the perspectives do blend together really well in a magical way near the end of the book. Another part I liked was how the antagonist characters were built and solidified through the overarching family history and dynamic plot line. Similarly, Shan's part of the story at the end really ties the beginning to end in a satisfying way.",Genre:["Fantasy","Romance"],"with-friends":"with-friends"}},Dv={Rating:"",Author:"",Month:3,Language:"",Genre:["Horror"],Thoughts:"+"},xv={"1":{Rating:"",Author:"",Month:2,Language:"",Genre:["Fiction"]},:{Rating:"",Author:"",Month:3,Language:"",Genre:[""],Thoughts:`



